import React, { FC } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  TextInput,
} from 'react-native';

const styles = StyleSheet.create({
  container: { flex: 1, alignItems: 'center', justifyContent: 'center' },
  text: { fontSize: 20 },
  color: { width: 80, height: 80 },
});

const Home: FC = () => (
  <View style={styles.container}>
    <Text style={styles.text}>Hello, W0rld</Text>
    <TouchableOpacity onPress={console.log}>
      <Text>Hello</Text>
    </TouchableOpacity>
    <TextInput placeholder="Something" keyboardType="email-address" />
    <TextInput placeholder="Password" secureTextEntry autoCapitalize="none" />
  </View>
);

export default Home;
